import React from 'react'
import {status} from "./imgs.js";
import Card from './Card.jsx';

function createcard(props)
{
    return(
    <div key={props.id} >
        <Card  val={props.pic} textval={props.text}/>
    </div>
    );
}


export default function Homecomponent() {
    return (
    <div>
        <div>
            {status.map(createcard)}
        </div>


    </div>
    )
}
